import React from 'react';

const TestTrading = () => {
  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold text-white">Trading Page - TEST</h1>
      <p className="text-gray-400 mt-4">This is the Trading page test component.</p>
    </div>
  );
};

export default TestTrading;
